graphql.schema:
type Comment {
 id: Int
 name: String
 email: String
 body: String
}

type Post {
 id: Int
 title: String
 body: String
 comments: [Comment]
}

type Query {
 user(id: Int!): User
}

type User {
 id: Int
 name: String
 email: String
 posts: [Post]
}

type Query {
 country(code: ID!): Country
}

type Country {
 code: ID!
 name: String!
}

type Country {
 code: ID
 name: String
 pop: Int
}

type Query {
 country(code: ID!): Country
}
